/// <summary> Получает или устанавливает код актива (валюты) </summary>
/// <param name="_asset"> Код актива (например, BTC, USDT) </param>
/// <returns> Код актива </returns>
[DataMember('asset')]
public CurrencyCode parmAsset(CurrencyCode _asset = asset)
{
    asset = _asset;
    return asset;
}

/// <summary> Получает или устанавливает доступный баланс </summary>
